('crm',1,'page_about_richText_zh_CN','page_about_richText','zh_CN','<h1>\n  <strong> (CRM)\n  </strong>\n</h1>\n<p>&nbsp;\n</p>\n<p>\n  <strong>\n  </strong>\n</p>'),
('crm',1,'page_about_richText2_en_US','page_about_richText2','en_US','<h1>About</h1>\n<table width=\"100%\" border=\"0\" collapse=\"\" align=\"center\">\n<tbody>\n<tr>\n<td>\n<h1><span style=\"font-size: 18pt; color: #333333;\">Welcome to the CRM App</span></h1>\n<p><span style=\"font-size: 11pt; color: #000000;\"> Track and Manage Your Customers and Business Opportunities</span></p>\n</td>\n</tr>\n<tr>\n<td>\n<p><span style=\"color: #333333;\">Use the free CRM app in your business to:</span></p>\n<ul>\n<li><span style=\"color: #333333;\">Track your prospects and customers,</span></li>\n<li><span style=\"color: #333333;\">Track sales opportunities, and</span></li>\n<li><span style=\"color: #333333;\">Submit sales proposals for approval.</span></li>\n</ul>\n<p><span style=\"color: #333333;\">This CRM app has been built to make use of the new features and capababilities of Joget DX Enterprise or Professional Edition.</span></p>\n<p><span style=\"color: #333333;\">Tips to Joget administrator:</span><span style=\"color: #333333;\"></span></p>\n<ul>\n<li><span style=\"color: #333333;\">Input your Joget SMTP server configurations in <a href=\"#request.contextPath?html#/web/console/setting/general\" target=\"_blank\" rel=\"noopener\" style=\"color: #333333;\">Web Console &gt; General Settings </a> to send email messages.</span></li>\n<li><span style=\"color: #333333;\">Input an email address for admin &amp; other users in <a href=\"#request.contextPath?html#/web/console/directory/users\" target=\"_blank\" rel=\"noopener\" style=\"color: #333333;\">Web Console &gt; Setup Users </a> for email notification to work.</span></li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>'),
('crm',1,'page_about_richText2_zh_CN','page_about_richText2','zh_CN','<p>Joget DX Enterprise / Professional\n</p>\n<p>Joget DX\n</p>\n<p>&nbsp;\n</p>\n<p>\n  <strong>App\n  </strong>\n</p>\n<p>\n</p>\n<p>CRM:\n</p>\n<ul>\n  <li>\n  </li>\n  <li>\n  </li>\n  <li>\n  </li>\n</ul>\n<p>\n  <strong>Joget:\n  </strong>\n</p>\n<ul>\n  <li> <a href=\"#request.contextPath?html#/web/console/setting/general\" target=\"_blank\"> &gt; \n    </a> Joget SMTP\n  </li>\n  <li> <a href=\"#request.contextPath?html#/web/console/directory/users\" target=\"_blank\"> &gt; \n    </a> \n  </li>\n</ul>'),
('crm',1,'page_Joget Resources_richText_en_US','page_Joget Resources_richText','en_US','<h1>Joget Resources\n</h1>\n\n<ul>\n<li><a href=\"https://www.joget.com/\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Home#</a></li>\n<li><a href=\"https://www.joget.org/download/\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Downloads#</a></li>\n<li><a href=\"http://www.jogetcloud.com/\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Cloud#</a></li>\n<li><a href=\"https://academy.joget.com/\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Academy#</a></li>\n<li><a href=\"https://www.youtube.com/user/jogetworkflow\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Videos#</a></li>\n<li><a href=\"https://marketplace.joget.org\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Marketplace#</a></li>\n<li><a href=\"https://community.joget.org\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Knowledge Base#</a></li>\n<li><a href=\"http://answer.joget.org\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Answers#</a></li>\n<li><a href=\"http://blog.joget.org/\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Blog#</a></li>\n<li><a href=\"https://play.google.com/store/apps/details?id=org.joget.mobile&amp;hl=en\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Mobile Android App#</a></li>\n<li><a href=\"https://itunes.apple.com/us/app/joget-workflow-mobile/id1084995640?mt=8\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Mobile iOS App#</a></li>\n<li><a href=\"https://github.com/jogetworkflow/\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Open Source Repository#</a></li>\n<li><a href=\"https://translate.joget.org\" target=\"_blank\" rel=\"noopener\">#i18n.Joget Translations#</a></li>\n<li><a href=\"http://joget.org/buy-enterprise-edition-license/\" target=\"_blank\" rel=\"noopener\">#i18n.Purchase Joget License#</a></li>\n</ul>'),
