('expenseclaim',1,'page_about_richText_en_US','page_about_richText','en_US','<h1>About</h1>\n<table width=\"100%\" border=\"0\" collapse=\"\" align=\"center\">\n<tbody>\n<tr>\n<td>\n<h1><span style=\"font-size: 18pt; color: #333333;\">Expenses Claim App</span></h1>\n<p><span style=\"font-size: 11pt; color: #000000;\"> Track, Review and Manage Employee Expenses Claims </span></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>The Expenses Claim app allows employees to submit their expenses claims for reimbursements. The respective Head of Departments (HOD) will be able to review, track and approve all employee expenses claims before final reimbursements by the Finance Department.</p>\n<p><span style=\"color: #333333;\"><strong>Workflow Approval Cycle:</strong></span></p>\n<ol>\n<li>The claimant submits a New Expenses Claim.</li>\n<li>Expense claim is routed to the selected HOD for approval.</li>\n<li>If approved, the expense claim is routed to the Finance Department for verification and processing of payment.</li>\n<li>This app defaults the Finance Department approver to the \"admin\" user, which you can change in the \"Map Participants to Users\" screen.</li>\n<li>HOD can request the claimant to resubmit the expense claim and the expense claim will redirected back to the claimant\'s inbox for evaluation, or the HOD can reject it, which will end the process flow.</li>\n</ol>\n<p><span style=\"color: #333333;\">This Expenses Claim app has been built to make use of the new features and capababilities of Joget DX Enterprise or Professional Edition.</span></p>\n<p><span style=\"color: #333333;\"><strong>Before using this app, perform the following steps: (Need admin role permission)</strong></span></p>\n<ol>\n<li>Set up the <a href=\"#request.contextPath?html#/web/userview/expenseclaim/home/_/setupCategory\" target=\"_blank\" rel=\"noopener\">Claim Categories </a> (Example: Entertainment, Medical, Mileage and Toll, etc.).</li>\n<li>Input your Joget DX SMTP server configurations in&nbsp; <a href=\"#request.contextPath?html#/web/console/setting/general\" target=\"_blank\" rel=\"noopener\">Web Console &gt; General Settings </a>&nbsp;to send email messages.</li>\n<li>Input an email address for admin user in&nbsp; <a href=\"#request.contextPath?html#/web/console/directory/users\" target=\"_blank\" rel=\"noopener\">Web Console &gt; Setup Users </a>&nbsp;for email notification to work.</li>\n</ol>\n</td>\n</tr>\n</tbody>\n</table>'),
('expenseclaim',1,'page_about_richText_zh_CN','page_about_richText','zh_CN','\n<h1>\n</h1>\n<p>Joget DX Enterprise / Professional\n</p>\n<p>Joget DX\n</p>\n<p>&nbsp;\n</p>\n<p>(HOD)\n</p>\n<p>&nbsp;\n</p>\n<p>\n  <strong>\n  </strong>\n</p>\n<ol>\n  <li>\n  </li>\n  <li>HOD\n  </li>\n  <li> (admin)\n  </li>\n  <li>HODHOD\n  </li>\n</ol>\n<p>&nbsp;\n</p>\n<p>\n  <strong>: ()\n  </strong>\n</p>\n<ol>\n  <li> \n    <a href=\"#request.contextPath?html#/web/userview/expenseclaim/home/_/setupCategory\" target=\"_blank\">\n    </a> (: )\n  </li>\n  <li> <a href=\"#request.contextPath?html#/web/console/setting/general\" target=\"_blank\"> &gt; \n    </a> Joget SMTP\n  </li>\n  <li> <a href=\"#request.contextPath?html#/web/console/directory/users\" target=\"_blank\"> &gt; \n    </a> \n  </li>\n</ol>\n<p> \n</p>'),
