('isr',1,'page_about_richText_en_US','page_about_richText','en_US','<h1>About</h1>\n<table width=\"100%\" border=\"0\" collapse=\"\" align=\"center\">\n<tbody>\n<tr>\n<td>\n<h1><span style=\"font-size: 18pt; color: #333333;\">Internal Service Request App</span></h1>\n<p><strong><span style=\"font-size: 11pt; color: #000000;\">Manage, Approve and Track Interdepartmental Requests</span></strong></p>\n</td>\n</tr>\n<tr>\n<td>\n<p>This is an Internal Service Request (ISR) app that allows users to make and manage inter-departmental service requests.</p>\n<p>Users will be able to make requests to specific head of department (HOD), who can then either resolve the request or assign the task to a subordinate for further action. This app also provides overall ISR reporting.&nbsp;</p>\n<p>The Internal Service Request app has been built to make use of the new features and capababilities of Joget DX Enterprise or Professional Edition.</p>\n<p><strong>Tips to Joget administrator: </strong></p>\n<ul>\n<li>Input your Joget SMTP server configurations in <a href=\"#request.contextPath?html#/web/console/setting/general\" target=\"_blank\" rel=\"noopener\">Web Console &gt; General Settings</a>&nbsp;to send email messages.</li>\n<li>Input an email address for admin user in <a href=\"#request.contextPath?html#/web/console/directory/users\" target=\"_blank\" rel=\"noopener\">Web Console &gt; Setup Users</a>&nbsp;for email notification to work.</li>\n</ul>\n</td>\n</tr>\n</tbody>\n</table>'),
('isr',1,'page_about_richText_zh_CN','page_about_richText','zh_CN','\n<h1>\n  \n</h1>\n<p>\n  <strong>&nbsp;\n  </strong>\n</p>\n<p>\n  <strong>\n  </strong>\n</p>\n<p>Joget DX Enterprise / Professional\n</p>\n<p>Joget DX\n</p>\n<p>&nbsp;\n</p>\n<p>\n  <strong>\n  </strong>\n</p>\n<p>(ISR)\n</p>\n<p>(HOD)\n</p>\n<p>\n</p>\n<p>\n  <strong>Joget:\n  </strong>\n</p>\n<ul>\n  </li>\n  <li> <a href=\"#request.contextPath?html#/web/console/setting/general\" target=\"_blank\"> &gt; \n    </a> Joget SMTP\n  </li>\n  <li> <a href=\"#request.contextPath?html#/web/console/directory/users\" target=\"_blank\"> &gt; \n    </a> \n  </li>\n</ul>'),
('isr',1,'page_about_richText1_en_US','page_about_richText1','en_US','\n<p>\n  <strong>Internal Service Request\n  </strong>\n</p>\n<p>\n  <strong>&nbsp;\n  </strong>\n</p>\n<p>\n  <strong>Introduction\n  </strong>\n</p>\n<p>The '),
